
def findTheDifference(s: str, t: str) -> str:
    sl = len(s)
    if sl == 0:
        return t[0]
    ab = [0] * 26

    for i in range(sl):
        ab[ord(s[i])-ord('a')] -= 1
        ab[ord(t[i])-ord('a')] += 1
    ab[ord(t[sl])-ord('a')] += 1
    for i in range(26):
        if ab[i] > 0:
            return chr(ord('a')+i)

def findTheDifferenceWithSum(s: str, t: str) -> str:
    return chr(sum(ord(i) for i in t) - sum(ord(i) for i in s))

def findTheDifferenceWithXOR(s: str, t: str) -> str:
    res = 0
    for i in s+t:
        res^=ord(i)
    return chr(res)

if __name__ == "__main__":
    test_cases = [
        ['abcd','abcde','e'],
        ['','y','y'],
        ["","",'t']
    ]
    for t in test_cases:
        print(findTheDifferenceWithXOR(t[0],t[1]),'|',t[2])
